import React from 'react';

const Video = (props) => (
    <div>
        {props.data.previewUrl}
    <video width="320" height="240" autoPlay>
    <source src={props.data.previewUrl} type="video/mp4" />
    <source src={props.data.previewUrl} type="video/oog" />
</video>
</div>
);

export default Video;
